import React from 'react';
// components
import Header from './layouts/Header';
import Footer from './layouts/Footer';
function HomePage(){
    return(
        <div>
            <Header/>
            <div className="home">
                <img src={process.env.PUBLIC_URL +"/slider_1.jpg"} alt="slider_1" height="100%" width="100%" justify="middle"></img>
            </div>
            <Footer/>       
        </div>
    )
};
export default HomePage;
